import PySimpleGUI as sg

icone = b""

def seleciona_arquivo():
    """Cria a janela para procurar e criar a base de dados"""
    layout = [
        [sg.Text('Caminho para seu arquivo')],
        [sg.Combo(sg.user_settings_get_entry('-filenames-', []), default_value=sg.user_settings_get_entry(
            '-last filename-', ''), size=(80, 1), key='-FILENAME-'), sg.FileBrowse()],
        [sg.Button('Go'), sg.Button('Exit')]
    ]
    
    event, values = sg.Window('Insira o caminho para o seu arquivo', layout, icon= icone, size = (500,100), resizable= True).read(close=True)
    
    if event == 'Go':
        sg.user_settings_set_entry(
            '-filenames-', list(set(sg.user_settings_get_entry('-filenames-', []) + [values['-FILENAME-'], ])))
        sg.user_settings_set_entry('-last filename-', values['-FILENAME-'])
    
    return values['-FILENAME-']

def popup(title: str, inputs: list[str], last:bool = False)->str:
    layout = [  
                [sg.Text(title, expand_x= True, expand_y= True)],
            ]
    
    if last:
        back = sg.Button(inputs.pop(), expand_x= True, expand_y= True)
        layout += [
                    [sg.Button(i, expand_x= True, expand_y= True) for i in inputs],
                    [back]
                    ]
    
    else:
        layout += [
                    [sg.Button(i, expand_x= True, expand_y= True) for i in inputs]
                    ]
    
    # Create the Window
    event, values = sg.Window(title, layout, element_justification='center', icon= icone, size = (350,100), resizable= True).read(close=True)
    # Event Loop to process "events" and get the "values" of the inputs
    return event

def popup_text(title: str, question:str)->str:
    layout = [  
                [sg.Text(title, expand_x= True, expand_y= True)],
                [sg.Text(question, expand_x= True, expand_y= True ), sg.InputText(key='-INPUT-', expand_x= True, expand_y= True)],
                [sg.Button('enviar', expand_x= True, expand_y= True)]
            ]
    
    # Create the Window
    event, values = sg.Window(title, layout, element_justification='center', icon= icone, size = (350,100), resizable= True).read(close=True)
    # Event Loop to process "events" and get the "values" of the inputs
    
    return values['-INPUT-']


